import React, { Component } from "react";

class Stage extends Component {
  render() {
      const{task,tasks}=this.props
    return (
      <div name='Tasks' >
        {//task.content
        tasks.map((task)=>{
            return(<div key={task.id}>{task.content}</div>)
        })
        }
      </div>
    );
  }
}

export default Stage;
